import React from 'react';
import {useSrate} from 'react';
import MySlider from './MySlider';

function MyRGBPanel(){
    const panelCSS={
        display:"fles",
        border:"1px solid black",
        borderRadius:"10px",
        width:"300px"
    };
    return(
    <>
        <h3>MyRGBPanel元件</h3>
        <div style={panelCSS} />
        <div 
            style={{backgroundColor:"red",width:"200px",height:"100px"}} 
        />
        <MySlider color="RED" />
        <MySlider color="GREEN"/>
        <MySlider color="BLUE"/>
    </>
    );
}

export default MyRGBPanel;
